export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},pV6A8p12IM:{data:{id:1616,attributes:{imdbId:"tt4193394",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjIyNDg4OTYwOF5BMl5BanBnXkFtZTgwOTQ3ODgwOTE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"81%"},{Source:"Metacritic",Value:"78\u002F100"}],item_lang:{data:{id:2279,attributes:{title:d,plot:"Set in 1951, the story follows Marcus Messner, the idealistic son of a humble kosher butcher from Newark, N.J. Marcus leaves for Ohio to study at a small, conservative college, where he finds himself at odds with the administration, grapples with anti-Semitism and sexual repression and pines after a troubled girl.",slug:"indignation"}}},books:{data:[{id:8389,attributes:{title:d,description:"Against the backdrop of the Korean War, a young man faces life’s unimagined chances and terrifying consequences. It is 1951 in America, the second year of the Korean War. A studious, law-abiding, intense youngster from Newark, New Jersey, Marcus Messner, is beginning his sophomore year on the pastoral, conservative campus of Ohio’s Winesburg College. And why is he there and not at the local college in Newark where he originally enrolled? Because his father, the sturdy, hard-working neighborhood butcher, seems to have gone mad -- mad with fear and apprehension of the dangers of adult life, the dangers of the world, the dangers he sees in every corner for his beloved boy. As the long-suffering, desperately harassed mother tells her son, the father’s fear arises from love and pride. Perhaps, but it produces too much anger in Marcus for him to endure living with his parents any longer. He leaves them and, far from Newark, in the midwestern college, has to find his way amid the customs and constrictions of another American world. Indignation, Philip Roth’s twenty-ninth book, is a story of inexperience, foolishness, intellectual resistance, sexual discovery, courage, and error. It is a story told with all the inventive energy and wit Roth has at his command, at once a startling departure from the haunted narratives of old age and experience in his recent books and a powerful addition to his investigations of the impact of American history on the life of the vulnerable individual.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0QjIx_AYs6gC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Roth, Philip"],firstBook:true,published:"2008-09-16",publisher:"HarperCollins",subtitle:b}},{id:8390,attributes:{title:"Philip Roth: Nemeses (LOA #237)",description:"What kind of choices fatally shape a life? How does the individual withstand the onslaught of circumstance? These are the dark questions that animate Nemeses, the quartet of thematically related short novels that are published here together for the first time in this final volume of The Library of America’s definitive edition of Philip Roth’s collected works. Everyman (2006) is the sparse and affecting story of one man’s lifelong skirmish with mortality. Set against the backdrop of the Korean War, Indignation (2008) is the extraordinary narrative of a young man struggling against the conformity of McCarthy-era America and his father’s overwhelming fear. In The Humbling (2009), aging actor Simon Axler embarks on a risky and aberrant affair in a desperate attempt to recoup his lost artistic gifts. And in Nemesis (2010), Roth offers an exacting portrait of the emotions—fear and anger, bewilderment and grief—bred by a polio epidemic in Newark in the summer of 1944. Philip Roth is the only living American novelist to have his work published in a comprehensive, definitive edition by The Library of America. He has received the Pulitzer Prize, the National Book Award and the National Book Critics Circle Award twice, the PEN\u002FFaulkner Award three times, the National Medal of Arts, and the Gold Medal in Fiction, the highest award of the American Academy of Arts and Letters. LIBRARY OF AMERICA is an independent nonprofit cultural organization founded in 1979 to preserve our nation’s literary heritage by publishing, and keeping permanently in print, America’s best and most significant writing. The Library of America series includes more than 300 volumes to date, authoritative editions that average 1,000 pages in length, feature cloth covers, sewn bindings, and ribbon markers, and are printed on premium acid-free paper that will last for centuries.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9aZNEAAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[f],firstBook:e,published:"2013-02-07",publisher:h,subtitle:"Everyman \u002F Indignation \u002F The Humbling \u002F Nemesis"}},{id:8391,attributes:{title:d,description:"Nous sommes en 1951, seconde année de la guerre de Corée. Marcus Messner, jeune homme de dix-neuf ans, intense et sérieux, d'origine juive, poursuit ses études au Winesburg College, dans le fin fond de l'Ohio. Il a quitté l'école de Newark, dans le New Jersey, où habite sa famille. Il espère par ce changement échapper à la domination de son père, boucher de sa profession, un homme honnête et travailleur, mais qui est depuis quelque temps la proie d'une véritable paranoïa au sujet de son fils bien-aimé. Fierté et amour, telles sont les sources de cette peur panique. Marcus, en s'éloignant de ses parents, va tenter sa chance dans une Amérique encore inconnue de lui, pleine d'embûches, de difficultés et de surprises. Indignation, le vingt-neuvième livre de Philip Roth, propose une forme de roman d'apprentissage : c'est une histoire d'audace et de folie, d'erreurs et de tâtonnements, de résistances et de révélations, tant sur le plan sexuel qu'intellectuel. Renonçant à sa description minutieuse de la vieillesse et de son cortège de maux, Philip Roth poursuit avec l'énergie habituelle son analyse de l'histoire de l'Amérique - celle des années cinquante, des tabous et des frustrations sexuelles - et de son impact sur la vie d'un homme jeune, isolé, vulnérable.",thumbnail:b,authors:[f],firstBook:e,published:"2010-01-01",publisher:"Editions Gallimard",subtitle:b}},{id:8392,attributes:{title:"Philip Roth at 80: A Celebration",description:"On March 19, 2013, a distinguished group of writers and critics gathered at the Newark Museum’s Billy Johnson Auditorium in Newark, New Jersey, to celebrate the extraordinary career and lasting literary legacy of Philip Roth on the occasion of his 80th birthday. This keepsake volume gathers remarks from the evening’s speakers, a fitting tribute to the only living novelist whose work is collected in the Library of America series. Here you’ll find Jonathan Lethem, hilariously recounting his first consciousness-raising encounter with Roth’s work through the Kafkaesque novel The Breast; Hermione Lee, tracing the Shakespearian themes in Roth’s books, from Portnoy’s Complaint to The Humbling; Alain Finkielkraut, offering a deep reading of Roth’s final novel, Nemesis; Claudia Roth Pierpont, assessing Roth’s portrayal of women in such books as Sabbath’s Theater and The Human Stain; Edna O’Brien, recalling her long friendship with Roth; and the author himself, offering a quintessentially Rothian valediction.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kfUTBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f],firstBook:e,published:"2014-10-14",publisher:h,subtitle:b}},{id:8393,attributes:{title:d,description:b,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AL0xzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Perfection Learning Corporation"],firstBook:e,published:"2019-01-01",publisher:"Turtleback",subtitle:b}}]}}},meta:{}}},prerenderedAt:1694069549507}}("movie","","series","Indignation",null,"Philip Roth",1,"Library of America"))